import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  friends: string[] = [
    'Ari',
    'Ayken',
    'Kayzen',
    'Vasirus'
  ]
}
<h1>ngFor</h1>

<ul *ngFor="let friend of friends; index as i">
  <li>[{{ i }}] {{ friend }}</li>
</ul>
